import React from 'react';

function Search() {
	return (
		<section className="search-input">
			<i className="fa-solid fa-magnifying-glass"></i>
			<input
				type="search"
				name="search"
				placeholder="Search for movie or TV series"
			/>
		</section>
	);
}

export default Search;
